import React, {Component} from 'react';
import FlightServices from "../../services/FlightServices";
import AircraftServices from "../../services/AircraftServices";
import LocalizationProvider from "@mui/lab/LocalizationProvider";
import AdapterDateFns from "@mui/lab/AdapterDateFns";
import DateTimePicker from "@mui/lab/DateTimePicker";
import TextField from "@mui/material/TextField";
import Stack from '@mui/material/Stack';
import Flight from "../reusableComponents/entities/Flight";
import Aircraft from "../reusableComponents/entities/Aircraft";

class CreateFlightComponent extends Component {

    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <Flight
                    history={this.props.history}
                    button='Save'
                    title='Insert new flight'
                />
            </div>
        );
    }
}

export default CreateFlightComponent;
